  [],\n\t\"revision_timestamp\": \"2015-09-26T19:50:13.423180\",\n\t\"name\": \"dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro60bac\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115761 includes chemical,
  discrete sample, physical and profile data collected from MELVILLE in the Coral
  Sea and South Pacific Ocean from 1994-03-27 to 1994-06-25. These data include ALKALINITY,
  CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-14,
  DELTA HELIUM-3, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC
  PRESSURE, NEON, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY,
  SILICATE, Tritium (Hydrogen isotope), WATER TEMPERATURE and pH. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  Christopher D. Winn of Hawaii Pacific University, Frank J. Millero of Rosenstiel
  School of Marine and Atmospheric Science and Catherine Goyet of University of Perpignan
  via Domitia; Institute of Modeling and Analysis of Geo-Environment and Health as
  part of the WOCE_P21 data set.nnThe World Ocean Circulation Experiment (WOCE) was
  a major component of the World Climate Research Program with the overall goal of
  better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
